cordova.define("com.jiedaibao.imageupload.ImageUpload", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       uploadImage : function(uri, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'ImageUpload',
            'uploadImage',
            [{
             "uri": uri,
             }]
            );
       }
    }
  }
);
